import { Grid, List, ListItem, Paper } from "@mui/material";
import { useSelector } from "react-redux";
import React from "react";
export default function CalenderHistory(){
    const waterCans = useSelector((state) => state.counter.waterCans);
    return(
        <Grid>
            <h1>History(this month)</h1>
            <Paper>
            <List style={{width:400}}>
        {waterCans?.map(({ capacity, date, price }, i) => (
          <ListItem>
            <p>{date.toLocaleString().split(",")[0]}</p>
            <span>{price}</span>
            <span>{capacity} L</span>
          </ListItem>
        ))}
      </List>
            </Paper>
        </Grid>
    )
}
